INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES (2,'node',' about me this is the portfolio site of jorge silva  here you ll find all types of work including logos posters and websites jorge silva has knowledge different programs such as photoshop and illustrator and knowledge of how to build the web by html css flash unfortunately for such a firm believer in standards  php   and trough different cmss like  wordpress joomla drupal  his design style aspires always to be simple  convinced of the power of simple solutions to problems in design  ',0),(20,'node',' iberoamerican leadership congress logo logo designed for the iberoamerican leadership congress 2011 held in puerto rico the logo was designed with the utmost simplicity in mind the logo consists in only one line that contructs the whole logo and idea also develpod in another proyect the typography surrounds the logo to keep up with it s linear form the garita was used as a way to give a visual representation to a conference based on the very abstract notion of leadership hard to represent visually using the national symbol instead  logo portfolio  ',0),(19,'node',' vete de internado series of posters done to promote internships three posters were designed to promote diffrent types of international internship experiences working with ngo s youth empowerment programs and cultural ambassadorship programs it was important to design a series of poster 1 explaining all three diffrent types of internships and 2 to keep up with the organization s branding aiesec this was achieved thru the use of template in which the changing elements were given more attention thru positioning typography and color an angled spacial organization was also used to bring tension and attention to poster  portfolio poster  ',0),(15,'node',' logo aiesec ro piedras logo done for aiesec ro piedras local commiteethis logo was designed with the idea of a single line constituting the whole logo at the same time the logo appears and disappears the whole logo shows itself through the discountinuity of a line and the whole image of the organisation through this ephemeralitysince the organization is constituted by students of the university of puerto rico the image of the tower was used as a way to give an image through this emblamtic building often used to represent the university nevertheless through the use of a diffrent simpler aesthetic the use of this architectural element was graspped by organization instead of bein just a mere duplicate of the university s image  portfolio  ',0),(14,'node',' exchange logo logo done for aiesec ro piedras  exchange team the logo was designed as a way to give an image to a tean inside the organization that focuses on arranging internships and exchange participants from all over the wold while utilizing intricate forms and shapes the simplest pallette was used the logo has a rugged feel balanced by it s outline that orders and balances the rest of the composition  logo portfolio  ',0),(25,'node',' emoticon me  portfolio  ',0),(27,'node',' top aasdf  ',0),(26,'node',' top  portfolio  ',0),(22,'node',' talent management logo designe for aiesec puerto rico s talent management team the talent management team inside this organization aiesec is responsible for dealign with providing the correct experience for all members taking the the team s role in the organization a logo was designed taking in the idea of building and the sum of the parts to give the entity an aesthetically pleasing image simple elementary colors were used to denote the contrast of the forms while empathizing the structural unity related to the idea of the organizational unity the entity itends to provide lastly a very expressive but clear typograhpy was used to balance the rest of the composition  logo portfolio  ',0),(12,'node',' acreditacin facultad de administracin de empresas  portfolio  ',0),(13,'node',' album cover gatoelctrico album cover and logo design for gatoelectrico  portfolio  ',0),(24,'node',' the games simple flyer designed for an event  portfolio  ',0),(23,'node',' communications logo logo designed for aiesec communications team  portfolio  ',0),(18,'node',' good bye lenin  flyer with information and basic plot for the movie good bye lenin   portfolio  ',0),(17,'node',' flyer arpeh  portfolio  ',0),(16,'node',' flyer magdalane sisters flyer done including information and brief introduction to the movie magdalane sisters  portfolio  ',0),(28,'node',' chatka camp this website was done for a the chatka summer camp the site is a very simple site done over a year ago the site is a basic presentation site for the camp because of this a very simple layout was used the design was a combination of a redesign taking some of the features used in the previous site and new ideas the aesthethics of the site reference the camp brand and logo dark yellos light browns while making use of the outdoors present in previous design and very portinent for this type of summer camp the site employs jquery technology for galleries and tabs animated gifs for the menus flickr embeddeds and simple html visit site  portfolio web  ',0),(29,'node',' interleacroft website done for interleacroft a proyect established in 2009 to launch and promote the romanization of intellectual property for this emerging and daring undertaking a website was created to showcase and present the institution and it s ideas as such the sites presents what the institution does serves as a platform for trainings and courses and for spreading the ideas of this proposition thru the intituion s blog in terms of design the image of the instituion was considered at all times the pallette and typography utilized both in the website and in the logo serve to show the balance between the innovation inspired by what the proyect proposes and the formality intertwined in the legal tradition the site was created utilizing joomla cms technology the technical part of the proyect was an challenge considering the necesity of having a website available in both english and spanish also the site is integrated to paypal for some ecomerece features requested by the client to book training and enable the selling of a book visit site  logo portfolio web  ',0),(21,'node',' sal del salon  series of posters to promote internships through these posters designed for a campaign to promote internation internships in education the material was designed to draw viewers attention thru the use of pictures big nice good pictures the idea was to lure thru the seductivness of the international imagery taking the images as the most important element in the design the typography it s messages and the institutional branding were designed acordingly a lot of attention was addressed towards the relationships between all the diffrente materials thru the format and typography the similarities were empathized thru the colors and some spacial accomodations the diffrences were rescued  portfolio poster print  ',0),(30,'node',' cc im application onepage website done as an application for a personal application a simple onepage website was done with simple html ana css the site showcased very simple solid design utilizing some css3 technology and the google fonts api the visual aspect of every detail was given very special attention to balance the simplicty of the site with the amount of content and good visual presentation visit site  portfolio web  ',0),(31,'node',' noeldavilanet website for musician writer noel davila after noel davila s frustration with his very busy webmaster i cms and redesign was done for noeldavilanet the very simple and user friendly wordpress was used to provide a solution that would empower the user to manage his own content instead of relying on a designer this wordpress instaltion provides the capabilites for download management social media channels management quotes and latests news the chance was taken to perform a redesign on the website the site is now much more user friendly than the previous design and much more aesthetically pleasing the colors yellow black and grey were used to denote contrats and degrees of importance in the page this site is still in the design process it will be launched january 2011 by request of the client visit site  portfolio web  ',0),(32,'node',' iberoamerican leadership congressorg site designed for the iberoamerican leadership congress 2011 held in puerto rico the site as designed mostly as a portal for information related to the congress this is mainly a content site and was designed accordingly through it s horizontallity through it s white background and typography the experience is designed for the user to read social media was also integrated to promote the congress among it s visitros the design is based on the previous logo design the pallette utilizes diffrent flavos of blue to contrast elements in the page also diffrent shades of gray were used and incoporated almost as a fade of the dominant blue background this type of light gray was used mostly to differentiate diffrent spaces in the page the menu typography is also very intresting in how it was utilized as a way to mark both the professional aspect of the conferencas as well as the youth of it s participants this site will be launched very shortly and is on the final stages of it s design visit site  portfolio web  ',0);
